uint8_t doorSensor_busy(void)
{
	return doorSensorRunning_flag;
}

void doorSensor_tick(void)
{
	static uint32_t index;
	static uint8_t repeat_counter;
	// perform state action
	switch(doorSensor_currentState) {
		case doorSensor_init_st: 
			index = 0;
			repeat_counter = 0;
			break;
		case doorSensor_waiting_for_start_st:
			index = 0;
			repeat_counter = 0;
			break;
		case doorSensor_send_sound_st:
			DAC->DHR8R1 = sound_data_alert[index];
			DAC->SWTRIGR |= DAC_SWTRIGR_SWTRIG1;
			index++;
			break;
		default:
			break;
	}
	// perform state transition
	switch(doorSensor_currentState) {
		case doorSensor_init_st: 
			doorSensor_currentState = doorSensor_waiting_for_start_st;
			break;
		case doorSensor_waiting_for_start_st:
			if(doorSensorRunning_flag)
				doorSensor_currentState = doorSensor_send_sound_st;
			else
				doorSensor_currentState = doorSensor_waiting_for_start_st;
			break;
		case doorSensor_send_sound_st:
			if(index >= SOUND_DATA_SIZE)
			{
				if(repeat_counter >= NUM_REPEATS)
				{
					doorSensor_currentState = doorSensor_waiting_for_start_st;
					index = 0;
					repeat_counter = 0;
					doorSensorRunning_flag = 0;
					GPIOC->ODR ^= (1 << GREEN_LED_PC);
				}
				else
				{
					doorSensor_currentState = doorSensor_send_sound_st;
					index = 0;
					repeat_counter++;
					GPIOC->ODR ^= (1 << ORANGE_LED_PC);
				}
				
			}
			else
			{
				doorSensor_currentState = doorSensor_send_sound_st;
			}
			break;
		default:
			break;
	}
}

void blueLED_tick(void) 
{
	static uint16_t counter;
	
	switch(blueLED_currentState)
	{
		case blueLED_init_st:
			counter = 0;
			blueLED_currentState = blueLED_waiting_st;
			break;
		case blueLED_waiting_st:
			counter++;
			if(counter < 7500)
			{
				blueLED_currentState = blueLED_waiting_st;
				break;
			}
			else
			{
				blueLED_currentState = blueLED_toggle_st;
				break;
			}
		case blueLED_toggle_st:
			counter = 0;
			GPIOC->ODR ^= (1 << BLUE_LED_PC);
			blueLED_currentState = blueLED_waiting_st;
			break;
		default:
			break;
	}
}

void Interrupts_Init(void)
{
	// Enable interrupt on PA1
	RCC->APB2ENR 			|= RCC_APB2ENR_SYSCFGCOMPEN;
	SYSCFG->CFGR1 		|= SYSCFG_EXTICR1_EXTI0_PA;
	SYSCFG->EXTICR[0] |= SYSCFG_EXTICR1_EXTI0_PA;
	EXTI->IMR 				|= 1; // Enable/unmask interrupt request from line 0
	EXTI->RTSR 				|= 1; // Configure EXTI input line 0 to have a rising-edge trigger
	NVIC_EnableIRQ(EXTI0_1_IRQn);
	NVIC_SetPriority(EXTI0_1_IRQn, 2);
}

void Timers_Init(void)
{
	// Enable TIM2
	RCC->APB1ENR			|= 	(RCC_APB1ENR_TIM2EN);
	
	// Set Timer 2 to 15KHz (PSC = 12; ARR = 41)
	TIM2->PSC					|= 	(0xc);
	
	// Use the counter preload (ARR) value
	TIM2->ARR					&= 0;
	TIM2->ARR					|= 	(0x29);
	
	// Up-counter enabled
	TIM2->CR1					|= 	TIM_CR1_ARPE;
	
	// Update interrupt enable
	TIM2->DIER				|= 	TIM_DIER_UIE; 	
	
	NVIC_EnableIRQ(TIM2_IRQn);
	NVIC_SetPriority(TIM2_IRQn, 2);
}

void DAC_Init(void)
{
	RCC->APB1ENR |= RCC_APB1ENR_DACEN;
	
	DAC->CR |= 	DAC_CR_TSEL1 |
							DAC_CR_TEN1 |
							DAC_CR_EN1;
	
	DAC->SWTRIGR |= DAC_SWTRIGR_SWTRIG1;
}


void GPIO_Init(void)
{
	
	RCC->AHBENR |= 	RCC_AHBENR_GPIOCEN |
									RCC_AHBENR_GPIOAEN;
	
	// Setting GPIO Pins to output, low speed, no pull-up, no pull-down
	GPIOC->MODER 		|= 	(MODE_OUTPUT << RED_LED_PC * 2) |
											(MODE_OUTPUT << BLUE_LED_PC * 2) |
											(MODE_OUTPUT << ORANGE_LED_PC * 2) |
											(MODE_OUTPUT << GREEN_LED_PC * 2);
	
	GPIOA->MODER		|= 	 MODE_ANALOG << DAC_PA * 2;
	
	GPIOC->OTYPER 	|= 	(OUTPUT_PP << RED_LED_PC) | 
											(OUTPUT_PP << BLUE_LED_PC) | 
											(OUTPUT_PP << ORANGE_LED_PC) | 
											(OUTPUT_PP << GREEN_LED_PC);
	
	GPIOC->OSPEEDR 	|= 	(GPIO_SPEED_FREQ_LOW << RED_LED_PC * 2) | 
											(GPIO_SPEED_FREQ_LOW << BLUE_LED_PC * 2) | 
											(GPIO_SPEED_FREQ_LOW << ORANGE_LED_PC * 2) | 
											(GPIO_SPEED_FREQ_LOW << GREEN_LED_PC * 2);
											
	GPIOC->PUPDR		|= 	(GPIO_PULLDOWN << RED_LED_PC * 2) | 
											(GPIO_PULLDOWN << BLUE_LED_PC * 2) | 
											(GPIO_PULLDOWN << ORANGE_LED_PC * 2) | 
											(GPIO_PULLDOWN << GREEN_LED_PC * 2); 
	
	// Setting GPIO Pin to input, pull-down
	GPIOA->MODER		|= (GPIO_MODE_INPUT << IR_SENSOR_PA * 2);
	GPIOA->PUPDR		|= (GPIO_PULLDOWN << IR_SENSOR_PA * 2);
}

void State_Init(void)
{
	GPIOC->ODR 	&= 	~(1 << GREEN_LED_PC);
	GPIOC->ODR 	&= 	~(1 << ORANGE_LED_PC);
	GPIOC->ODR 	&= 	~(1 << RED_LED_PC);
	GPIOC->ODR 	&= 	~(1 << BLUE_LED_PC);
	TIM2->CR1 	|= 	TIM_CR1_CEN; // Enable TIM2
}

void Power_Init(void)
{
	//Stop all clocks and wait on EXTI interrupt
	PWR->CR &= (PWR_CR_LPDS | PWR_CR_PDDS); //stop mode, voltage regulator on
}

void System_Sleep(void)
{
	DAC->CR &= DAC_CR_EN1; //need to stop DAC, or it will continue to consume power
	SCB->SCR |= SCB_SCR_SLEEPDEEP_Msk | SCB_SCR_SLEEPONEXIT_Msk; //sleep on exit may not be needed
	
	__WFI();
}
